import React, { Component } from "react";
import {
  Button,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter,
  Form,
  FormGroup,
  Input,
  Label
} from "reactstrap";

export default class CustomModal extends Component {
  constructor(props) {
    super(props);
    this.state = {
      activeItem: this.props.activeItem
    };
  }

  render() {
    const { toggle, onSave } = this.props;
    return (
      <Modal isOpen={true} toggle={toggle}>
        <ModalHeader toggle={toggle}> Operator </ModalHeader>
        <ModalBody>
          <Form>
            <FormGroup>
              <Label for="operator">Operator</Label>
              <Label
                type="text"
                name="operator"
              />
            </FormGroup>
          </Form>
        </ModalBody>
        <ModalFooter>
        </ModalFooter>
      </Modal>
    );
  }
}
